import React from 'react';
import { Route, Routes, BrowserRouter } from 'react-router-dom';
import './App.css';
import SaleReport from './components/SaleReport';
import InventoryReport from './components/InventoryReport';
import AgingReport from './components/AgingReport';
import Cookies from 'js-cookie';
import * as Icon from 'react-bootstrap-icons';

const session_api = '/my_profile'
const MY_ROUTES = {'/inventory_report': 'Inventory Report' , '/sale_report': 'Sale Report', '/aging_report': 'Aging Report'}


class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      userDetails: {}
    }
  }

  componentDidMount() {
    const queryParams = new URLSearchParams(window.location.search);
    var accessToken = queryParams.get('access_token')
    if(accessToken){
      document.cookie = "access_token="+ accessToken
      queryParams.delete('access_token')
      window.location.search = queryParams
    }
    else{
      accessToken = Cookies.get('access_token')
      if(!accessToken){
        alert('Session Expired, Please login again')
        window.location = process.env.REACT_APP_AUTH_URL
        return 0;
      }
    }
    fetch(process.env.REACT_APP_API_URL + session_api, {method: 'GET', headers: {'Authorization': 'Bearer '+ accessToken}})
      .then(response => response.json())
      .then((response) => {
        if (response.error){
          alert('Session Expired, Please login again')
          window.location = process.env.REACT_APP_AUTH_URL
        }
        else{
          this.setState({userDetails: response.data})
        }
      })
      .catch((error) => {
        console.log("Something Went Wrong..." + error)
      })
  }

  render() {
    let search = window.location.search
    let userDetails = this.state.userDetails
    return (
      <div className="App">
        <nav class="navbar navbar-light bg-dark">
          <a class="navbar-brand" href="" style={{paddingLeft:'1rem'}}>
            <img src="https://www.app.liquid.diamonds/assets/LD_logo_banner_long_dark_bg.png" height="30" class="d-inline-block align-top" alt=""></img>
          </a>
        </nav>
        <nav class="navbar navbar-expand-lg navbar-light" style={{backgroundColor: "#e3f2fd"}}>
          <div class="collapse navbar-collapse" id="navbarText">
            <ul class="navbar-nav me-auto" style={{paddingLeft:'1rem'}}>
              {Object.entries(MY_ROUTES).map(([route, name]) => {
                let is_active_class = (route == window.location.pathname) ? 'active' : ''
                return(
                  <li class={"nav-item " +  is_active_class}>
                    <a class="nav-link" href={route + search}>{name}</a>
                  </li>
                )}
              )}
            </ul>
            {userDetails ?
            <ul class="navbar-nav navbar-left" style={{paddingRight:'6rem'}}>
              <li class="nav-item dropdown">
                <a class="nav-link dropdown-toggle" href="" id="userProfile" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                  <Icon.PersonFill color="black" size={25} />Welcome, {userDetails.name}
                </a>

                <div class="dropdown-menu dropdown-menu-right rdt_TableCol" aria-labelledby="userProfile" style={{minWidth:'25rem'}}>
                  <div class="row profile-details">
                    <div className="col-sm-1"><Icon.PersonFill color="black" size={20}/></div>
                    <div className="col-sm-2 text-left"> Name</div>
                    <div className="col-sm-1">:</div>
                    <div className='col-sm-8 text-left'> {(userDetails.name) ? userDetails.name : 'NA'}</div>
                  </div>

                  <div class="row profile-details">
                    <div className="col-sm-1"><Icon.EnvelopeAtFill color="black" size={20}/></div>
                    <div className="col-sm-2 text-left">Email</div>
                    <div className="col-sm-1">:</div>
                    <div className='col-sm-8 text-left'> {(userDetails.email) ? userDetails.email : 'NA'} </div>
                  </div>

                  <div class="row profile-details">
                    <div className="col-sm-1"><Icon.TelephoneFill color="black" size={20}/></div>
                    <div className="col-sm-2 text-left">Phone</div>
                    <div className="col-sm-1">:</div>
                    <div className='col-sm-8 text-left'> {(userDetails.phone) ? userDetails.phone : 'NA'}</div>
                  </div>

                  <div class="row profile-details">
                    <div className="col-sm-1"><Icon.PeopleFill color="black" size={20}/></div>
                    <div className="col-sm-2 text-left">Roles</div>
                    <div className="col-sm-1">:</div>
                    <div className='col-sm-8 text-left'> {(userDetails.roles) ? userDetails.roles.join(', ') : 'NA'}</div>
                  </div>
                </div>
              </li>
            </ul>
            : null}
          </div>
        </nav>

        <BrowserRouter>
          <Routes>
            <Route path="/sale_report" element={[<SaleReport/>]} />
            <Route path="/inventory_report" element={[<InventoryReport/>]} />
            <Route path="/aging_report" element={[<AgingReport/>]} />
          </Routes>
        </BrowserRouter>
    </div>
    )
  }
}
export default App;
